public class Driver {
    public static void main(String[] args) {
        test(1, "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT", new ArrayList<String>(Arrays.asList("AAAAACCCCC", "CCCCCAAAAA")));
        test(2, "AAAAAAAAAAAAAAAAAAAAAA", new ArrayList<String>(Arrays.asList("AAAAAAAAAA")));
        test(3, "ACACACACGTGTGTGT", new ArrayList<String>());
        test(4, "AAAAAAAAAAA", new ArrayList<String>(Arrays.asList("AAAAAAAAAA")));
        test(5, "ACGT", new ArrayList<String>());
        test(6, "", new ArrayList<String>());
    }

    public static void test(int testNo, String s, List<String> expectValue) {
        List<String> res = findRepeatedDnaSequences(s);

//        for(char[] row : board) {
//            for(char c : row) {
//                System.out.print(c + " ");
//            }
//            System.out.println("");
//        }
//        System.out.println("");
        if (res.equals(expectValue)) {
            System.out.println(testNo + ": Pass");
        } else {
            System.out.println(testNo + ": Fail");
            System.out.println("Expect " + expectValue + ", Return " + res);
        }
    }

    public static List<String> findRepeatedDnaSequences(String s) {
        List<String> res = new ArrayList<String>();
        if(s.length() < 10) return res;
        HashSet<Integer> all = new HashSet<Integer>();
        HashSet<Integer> repeat = new HashSet<Integer>();
        char[] map = new char[26];
        map['A' - 'A'] = 0;
        map['C' - 'A'] = 1;
        map['G' - 'A'] = 2;
        map['T' - 'A'] = 3;
        int hash = 0;
        for(int i = 0; i < 9; i++) {
            hash = hash << 2 | map[s.charAt(i) - 'A'];
        }
        for(int i = 9; i < s.length(); i++) {
            hash = (hash & 0x3FFFF) << 2 | map[s.charAt(i) - 'A'];
            if(!all.add(hash) && repeat.add(hash)) {
                res.add(s.substring(i - 9, i + 1));
            }
        }
        return res;
    }
}